// 公共方法
var getIndexUrl = function (app) {
    var indexPath = '';
    if (app) {
        indexPath = location.protocol + '//' + location.host + app;
    } else {
        indexPath = location.protocol + '//' + location.host;
    }
    return indexPath;
};
